import React from 'react';
import Card from './Card';

function Projects() {
    return (
        <Wrapper>
            {this.state.Card.map(card => (
                <Projects
                    id={card.id}
                    key={card.id}
                    name={card.name}
                    image={card.image}
                    description={card.description}
                />
            ))}
        </Wrapper>
    );
}

export default Projects;
